	(10,'2014-02-10 10:11:32','2014-03-26 18:03:19',X'27FD5AC8BC4D4D96BB75A2589520F14B','The bedGraph format allows display of continuous-valued data in track format. This display type is useful for probability scores and transcriptome data.','bedgraph',1,'Bed Graph',1,'bg',NULL),
